// CardView.js
import React from "react";
import Card from "./Card";
import "./CardView.css";

function CardView(props) {
  const card = props.cards.filter((item) => item.id == 1);
  console.log(card);
  return (
    <div className="card-view">
      {(Card) => (
        <Card key={card.id} volume={card.volume[1]} Rupee={card.Rupee} />
      )}
    </div>
  );
}

export default CardView;
